var b="url",c="配送方式.html",d="generationDate",e=new Date(1526031084363.64),f="isCanvasEnabled",g=false,h="isAdaptiveEnabled",i="sketchKeys",j="",k="s0",l="variables",m="OnLoadVariable",n="page",o="packageId",p="ed5802ceee7545a0b99a918859b69622",q="type",r="Axure:Page",s="name",t="配送方式",u="notes",v="说明",w="<p><span style=\"font-family:'微软雅黑';color:#333333;\">1.默认是快递配送（按钮被选中）</span></p><p><span style=\"font-family:'微软雅黑';color:#333333;\"><br></span></p><p><span style=\"font-family:'微软雅黑';color:#333333;\">2.门店自提几种交互情况：</span></p><p><span style=\"font-family:'微软雅黑';color:#333333;\">（1）用户收货地址经纬度正确且购买的订单里的处方药能在1个门店购买，则显示距离用户收货地址最近的三家门店，距离从近到远排列展示</span></p><p><span style=\"font-family:'微软雅黑';color:#333333;\">（2）用户收货地址经纬度不正确则显示：</span><span style=\"color:#999999;\">收货地址附近暂无推荐上门自提药店</span></p><p><span style=\"font-family:'微软雅黑';color:#333333;\">（3）用户收货地址经纬度正确但所买的药品不能在1家店自提：</span><span style=\"color:#999999;\">收货地址附近暂无推荐上门自提药店</span></p><p><span style=\"font-family:'微软雅黑';color:#333333;\"><br></span></p><p><span style=\"font-family:'微软雅黑';color:#333333;\">3.选择门店自提后，返回购买处方药页面配送方式栏显示相关门店</span></p><p><span style=\"font-family:'微软雅黑';color:#333333;\"><br></span></p><p><span style=\"font-family:'微软雅黑';color:#333333;\">4.推荐门店限制范围为300公里以内</span></p>",x="style",y="baseStyle",z="627587b6038d43cca051c114ac41ad32",A="pageAlignment",B="center",C="fill",D="fillType",E="solid",F="color",G=0xFFF9F9F9,H="image",I="imageHorizontalAlignment",J="near",K="imageVerticalAlignment",L="imageRepeat",M="auto",N="favicon",O="sketchFactor",P="0",Q="colorStyle",R="appliedColor",S="fontName",T="Applied Font",U="borderWidth",V="adaptiveStyles",W="interactionMap",X="diagram",Y="objects",Z="id",ba="52b6a8ed389f4167b2db7e478a654ecd",bb="label",bc="friendlyType",bd="组合",be="layer",bf="styleType",bg="visible",bh=true,bi="imageOverrides",bj="objs",bk="3ebd980a976d4353a9e48418a1803067",bl="location",bm="x",bn=537.5,bo="y",bp=1235.625,bq="5f3ee14921db405b853b087eca6cff91",br="ed442fd4d5c843d7b92fa592f8f3e613",bs